INSERT INTO `products` (`product_id`, `product_name`, `product_description`, `product_price`, `product_images`, `product_images2`, `product_category`, `pet_category`) VALUES
(2, 'food', 'very tasty food for your pet', 168, 'pet-parent/house.jpg', '', 0, 0),
(3, 'Pawsome Ball Launcher', 'The Pawsome Ball Launcher is a must-have toy for active dogs who love to play fetch. This launcher allows you to throw tennis balls further and faster, providing your furry friend with endless fun and exercise. It\'s perfect for outdoor play in the park or backyard. Simply load the ball into the launcher, pull back the handle, and release to send the ball flying. It\'s a great way to bond with your dog and keep them entertained for hours on end.', 500, '', '', 0, 1),
(4, 'FurryFriends Catnip Mouse', 'The FurryFriends Catnip Mouse is a classic toy designed to captivate your cat\'s attention and stimulate their natural instincts. Made from soft, plush material and filled with premium catnip, this mouse toy is irresistible to cats of all ages. Whether your cat loves to pounce, chase, or cuddle, this toy is sure to provide hours of entertainment and enrichment. It\'s the purr-fect addition to your cat\'s toy collection.', 150, '', '', 0, 0),
(5, 'WoofWalk LED Dog Collar', 'The WoofWalk LED Dog Collar is a must-have accessory for night-time walks with your canine companion. Featuring bright LED lights with multiple flashing modes, this collar ensures that your dog is visible and safe during low-light conditions. It\'s made from durable and weather-resistant materials, making it suitable for all weather conditions. With its adjustable design and easy-to-use clip, it\'s comfortable for your dog to wear and easy for you to put on and take off. Enjoy nighttime walks with peace of mind knowing that your dog is safely visible to others.', 700, '', '', 1, 1),
(6, 'CozyPaws Heated Pet Bed', 'The CozyPaws Heated Pet Bed is the ultimate luxury for your furry friend, providing warmth and comfort on chilly nights. With its plush, heated design, this bed creates a cozy oasis for your pet to curl up and relax in. The built-in heating element provides gentle warmth to soothe tired muscles and joints, making it ideal for senior pets or those with arthritis. The removable, machine-washable cover makes cleaning a breeze, while the non-slip bottom keeps the bed in place on any surface. Treat your pet to the ultimate in comfort and relaxation with the CozyPaws Heated Pet Bed.', 1200, '', '', 2, 1),
(7, 'SnugglePup Comfort Blanket', 'The SnugglePup Comfort Blanket is a soft and cozy blanket that provides warmth and security for your beloved pup. Made from high-quality fleece material, this blanket is gentle on your dog\'s skin and provides a comfortable surface for them to rest on. Whether used in their bed, crate, or as a cuddle companion on the couch, this blanket will quickly become your dog\'s favorite. Its lightweight and portable design make it perfect for travel or outings. Treat your furry friend to the ultimate in comfort and relaxation with the SnugglePup Comfort Blanket.', 800, '', '', 2, 1),
(8, 'SparklePets Rhinestone Collar', 'The SparklePets Rhinestone Collar is a stylish accessory that will make your pet stand out from the crowd. Adorned with sparkling rhinestones, this collar adds a touch of glamour to your pet\'s look, whether they\'re out for a walk or lounging at home. Made from durable and comfortable material, it\'s gentle on your pet\'s skin and won\'t cause irritation. The adjustable design ensures a perfect fit, while the sturdy buckle keeps the collar securely in place. Treat your pet to a touch of luxury with the SparklePets Rhinestone Collar.', 350, '', '', 3, 1),
(9, 'MeowMunch Slow Feeder Bowl', 'The MeowMunch Slow Feeder Bowl is specially designed to promote healthy eating habits in cats. Its maze-like design encourages your cat to eat at a slower pace, reducing the risk of indigestion, vomiting, and obesity. This bowl is perfect for cats who tend to eat too quickly or gulp their food down. Made from durable and non-toxic material, it\'s safe for your cat to use every day. Plus, its anti-skid base prevents sliding and spills during mealtime. Help your cat enjoy mealtime at a healthier pace with the MeowMunch Slow Feeder Bowl.', 300, '', '', 4, 0),
(10, 'TangleFree Retractable Leash', 'The TangleFree Retractable Leash is a convenient and practical solution for walking your dog. Its retractable design allows your dog to explore their surroundings while giving you full control over their movements. The leash extends up to 16 feet, providing your dog with plenty of room to roam. It features a durable nylon ribbon that\'s resistant to wear and tear, ensuring long-lasting use. The ergonomic handle provides a comfortable grip, while the one-button brake and lock system allows you to easily adjust the leash length. Enjoy hassle-free walks with your furry friend using the TangleFree Retractable Leash.', 600, '', '', 5, 1),
(11, 'HappyTails Grooming Kit', 'The HappyTails Grooming Kit is a comprehensive set of grooming tools designed to keep your pet looking and feeling their best. This kit includes everything you need to maintain your pet\'s coat, nails, ears, and more. It features a variety of brushes, combs, clippers, and scissors, each specially designed for different grooming tasks. The ergonomic design and non-slip handles ensure comfortable and safe grooming sessions for both you and your pet. Keep your pet\'s coat shiny, tangle-free, and healthy with the HappyTails Grooming Kit.', 900, '', '', 6, -1),
(12, 'KittyKisses Litter Mat', 'The KittyKisses Litter Mat is a practical solution for keeping your floors clean and tidy around the litter box. Its unique honeycomb design traps litter scatter as your cat exits the box, preventing it from being tracked throughout your home. Made from durable and waterproof material, it\'s easy to clean with just a shake or vacuum. The non-slip backing keeps the mat in place, while the soft surface is gentle on your cat\'s paws. Say goodbye to messy floors and hello to cleanliness with the KittyKisses Litter Mat.', 400, '', '', 7, 0),
(13, 'AquaPaws Waterproof Dog Boots', 'The AquaPaws Waterproof Dog Boots are essential gear for protecting your dog\'s paws from harsh weather conditions. Whether it\'s rain, snow, or hot pavement, these boots provide a barrier between your dog\'s feet and the elements. Made from durable and waterproof material, they keep your dog\'s paws dry and comfortable during outdoor adventures. The adjustable straps ensure a secure fit, while the rugged soles provide traction and stability on any surface. Keep your dog\'s paws safe and healthy with the AquaPaws Waterproof Dog Boots.', 1000, '', '', 8, 1),
(14, 'PlayfulPurr Feather Teaser', 'The PlayfulPurr Feather Teaser is a fun and interactive toy that will keep your cat entertained for hours. Its colorful feathers mimic the movements of birds, triggering your cat\'s natural hunting instincts and encouraging active play. The flexible wand allows you to control the movement of the feathers, keeping your cat engaged and stimulated. It\'s the perfect toy for solo play or interactive playtime with your feline friend. Watch as your cat pounces, jumps, and swats at the feathers with delight.', 200, '', '', 0, 0),
(15, 'SniffSnack Interactive Feeder', 'The SniffSnack Interactive Feeder is a fun and engaging way to feed your pet while providing mental stimulation and enrichment. Its unique design allows you to hide treats or kibble inside, challenging your pet to use their sense of smell and problem-solving skills to access the food. It\'s perfect for preventing boredom and anxiety in pets who eat too quickly or need extra mental stimulation. Made from durable and non-toxic material, it\'s safe for your pet to use every day. Make mealtime fun and rewarding with the SniffSnack Interactive Feeder.', 450, '', '', 4, 0),
(16, 'SleepyTime Pet Hammock', 'The SleepyTime Pet Hammock is a cozy and comfortable bed for cats or small dogs to relax and unwind in. Its hammock-style design provides a soft and elevated sleeping surface that\'s perfect for lounging and napping. Made from durable and breathable fabric, it\'s suitable for year-round use and can be easily attached to any sturdy surface, such as a crate or window sill. The removable plush cushion adds extra comfort and warmth, making it the ultimate spot for your pet to curl up and sleep. Treat your furry friend to the ultimate in relaxation with the SleepyTime Pet Hammock.', 850, '', '', 2, 1),
(17, 'GlamourPaws Bowtie Collar', 'The GlamourPaws Bowtie Collar is a stylish accessory that will make your pet look dapper and sophisticated. Featuring a classic bowtie design, this collar adds a touch of elegance to your pet\'s appearance, whether they\'re attending a special occasion or just lounging at home. Made from high-quality materials, it\'s durable, comfortable, and easy to clean. The adjustable design ensures a perfect fit, while the sturdy buckle keeps the collar securely in place. Make your pet the star of the show with the GlamourPaws Bowtie Collar.', 400, '', '', 3, 1),
(18, 'WhiskerWhirl Laser Toy', 'The WhiskerWhirl Laser Toy is a fun and interactive toy that will keep your cat entertained for hours. Simply press the button to activate the laser beam, and watch as your cat chases and pounces on the moving light. Its unpredictable movements mimic the actions of prey, triggering your cat\'s natural hunting instincts and providing mental and physical stimulation. It\'s the perfect toy for solo play or interactive playtime with your feline friend.', 300, '', '', 0, 0),
(19, 'FreshPaws Odor Eliminator', 'The FreshPaws Odor Eliminator is a powerful spray that quickly neutralizes and eliminates pet odors from your home. Whether it\'s urine, feces, or general pet smells, this fast-acting formula targets and breaks down odor-causing molecules, leaving behind a fresh and clean scent. It\'s safe to use on a variety of surfaces, including carpets, upholstery, and pet bedding. Plus, it\'s non-toxic and environmentally friendly, making it safe for your pets and family. Say goodbye to unpleasant odors and hello to a fresh-smelling home with FreshPaws Odor Eliminator.', 250, '', '', 6, -1),
(20, 'Rollin\' Rover Dog Carrier', 'The Rollin\' Rover Dog Carrier is a convenient and comfortable way to transport your small dog on trips or outings. Its sturdy construction and padded interior provide a safe and cozy space for your pet to relax in while on the go. The mesh windows allow for plenty of ventilation and visibility, while the adjustable shoulder strap and padded handles make it easy to carry. With its stylish design and practical features, it\'s the perfect travel accessory for pet owners on the move.', 1500, '', '', 9, 1),
(21, 'CozyCove Cuddler Bed', 'The CozyCove Cuddler Bed is a luxurious bed designed to provide your dog with the ultimate in comfort and relaxation. Its plush, cave-like design provides a cozy and secure sleeping environment, while the soft, cushioned walls offer support and warmth. Made from high-quality materials, it\'s durable, breathable, and easy to clean. The removable cushion adds extra comfort and convenience, making it the perfect spot for your dog to curl up and sleep. Give your furry friend the gift of luxury with the CozyCove Cuddler Bed.', 1100, '', '', 2, 1),
(22, 'PurrfectPost Scratching Pole', 'The PurrfectPost Scratching Pole is a must-have accessory for cat owners looking to protect their furniture and satisfy their cat\'s natural scratching instincts. Its sisal rope scratching surface provides a durable and satisfying texture that encourages cats to scratch and stretch. The sturdy base ensures stability during use, while the tall height allows for full-body stretching and scratching. Plus, its compact design makes it easy to place in any room of the house. Say goodbye to shredded furniture and hello to a happy and healthy cat with the PurrfectPost Scratching Pole.', 700, '', '', 10, 0),
(23, 'SlurpStop Non-Spill Bowl', 'The SlurpStop Non-Spill Bowl is a practical solution for messy eaters and pets who tend to spill their food or water. Its unique design features a raised lip and sloped interior, preventing spills and splashes while your pet eats or drinks. The non-skid base keeps the bowl in place on any surface, reducing sliding and tipping. Made from durable and dishwasher-safe material, it\'s easy to clean and maintain. Say goodbye to messy floors and hello to stress-free feeding with the SlurpStop Non-Spill Bowl.', 350, '', '', 4, -1),
(24, 'HikingHound Backpack', 'The HikingHound Backpack is a must-have accessory for outdoor adventures with your dog. Its spacious design allows you to pack all the essentials for a day on the trail, including water bottles, snacks, toys, and more. The adjustable straps and padded back panel provide a comfortable fit for both you and your dog, while the durable construction ensures long-lasting use. With multiple pockets and compartments, it\'s easy to stay organized and prepared for any adventure. Hit the trails with your furry friend in style with the HikingHound Backpack.', 800, '', '', 8, 1),
(25, 'Waggin\'Waves Surfboard Toy', 'The Waggin\'Waves Surfboard Toy is a fun and interactive toy for dogs who love to play fetch and chase. Its surfboard-shaped design makes it easy for dogs to grab and carry, while the textured surface provides added grip and stimulation. Made from durable and non-toxic material, it\'s safe for dogs to chew and play with. Whether you\'re at the beach, park, or backyard, this toy is sure to provide hours of entertainment and exercise for your furry friend.', 250, '', '', 0, 1),
(26, 'FurryFresh Pet Cologne', 'The FurryFresh Pet Cologne is a refreshing spray that will keep your pet smelling clean and fresh between baths. Its gentle formula is safe for use on dogs and cats of all ages and breeds, providing long-lasting odor control without irritating their skin or coat. Simply spritz onto your pet\'s fur and gently massage in for instant freshness. The light and pleasant scent will leave your pet smelling great without overpowering their natural odor. It\'s the perfect finishing touch to your pet\'s grooming routine.', 200, '', '', 6, -1),
(27, 'ComfyCove Cozy Cave Bed', 'The ComfyCove Cozy Cave Bed is the ultimate retreat for dogs who love to burrow and snuggle. Its cave-like design provides a sense of security and warmth, while the plush interior offers maximum comfort and relaxation. Made from high-quality materials, it\'s durable, breathable, and easy to clean. The removable cushion adds extra comfort and convenience, making it the perfect spot for your dog to curl up and sleep. Treat your furry friend to the ultimate in comfort and coziness with the ComfyCove Cozy Cave Bed.', 1300, '', '', 2, 1),
(28, 'SnuggleSack Sleeping Bag', 'The SnuggleSack Sleeping Bag is a cozy and comfortable bed for cats or small dogs to curl up and sleep in. Its sleeping bag design provides a sense of security and warmth, while the plush interior offers maximum comfort and relaxation. Made from high-quality materials, it\'s durable, breathable, and easy to clean. The compact size makes it perfect for travel or placement in small spaces. Treat your furry friend to a restful night\'s sleep with the SnuggleSack Sleeping Bag.', 900, '', '', 2, 1),
(29, 'ChicCanine Designer Harness', 'The ChicCanine Designer Harness is a stylish and functional accessory for fashion-forward dogs. Its eye-catching design features vibrant colors and patterns, making your dog stand out from the crowd. Made from high-quality materials, it\'s durable, comfortable, and easy to adjust for a perfect fit. The sturdy D-ring allows for easy leash attachment, while the padded chest and back straps provide maximum comfort and support. Whether you\'re out for a walk or hitting the town, your dog will turn heads in the ChicCanine Designer Harness.', 600, '', '', 3, 1),
(30, 'MeowMist Hair Detangler', 'The MeowMist Hair Detangler is a must-have grooming product for cats with long or tangled fur. Its gentle formula helps to loosen knots and mats, making it easier to comb and brush out your cat\'s fur without causing discomfort or irritation. Simply spray onto your cat\'s coat and gently comb through to remove tangles and knots. The lightweight formula won\'t weigh down your cat\'s fur or leave behind any greasy residue. Keep your cat\'s coat looking smooth and shiny with MeowMist Hair Detangler.', 300, '', '', 6, 0),
(31, 'PurrFecta Scratching Pad', 'The PurrFecta Scratching Pad is a versatile and durable scratching surface for cats who love to scratch and stretch. Its corrugated cardboard material provides a satisfying texture that helps to sharpen claws and relieve stress. The large surface area and reversible design offer plenty of scratching space, while the compact size makes it perfect for placement in any room of the house. Plus, its affordable price makes it an economical choice for cat owners looking to protect their furniture and promote healthy scratching behaviors.', 500, '', '', 10, 0),
(32, 'WhiskerWipe Cleaning Wipes', 'The WhiskerWipe Cleaning Wipes are specially designed to clean and freshen your pet\'s fur and paws between baths. Their gentle formula removes dirt, dander, and odor-causing bacteria, leaving your pet\'s coat soft, smooth, and smelling fresh. Perfect for use after walks, playtime, or outdoor adventures, these wipes are a convenient way to keep your pet clean and comfortable on the go. Plus, their compact size makes them perfect for travel or everyday use. Keep your pet looking and feeling their best with WhiskerWipe Cleaning Wipes.', 150, '', '', 6, 0),
(33, 'HareHaven Exercise Wheel', 'The HareHaven Exercise Wheel is a fun and interactive toy for small pets like rabbits and guinea pigs. Its large running surface provides plenty of space for your pet to run and exercise, helping to promote physical and mental stimulation. The sturdy construction and non-slip base ensure stability during use, while the quiet operation won\'t disturb your pet or household. Whether used indoors or outdoors, this exercise wheel is sure to keep your furry friend happy and healthy.', 250, '', '', 0, 0),
(34, 'FinnyFrenzy Fish Tank Decor', 'The FinnyFrenzy Fish Tank Decor is a colorful and vibrant addition to any aquarium or fish tank. Its realistic design and bright colors create an eye-catching underwater landscape for your fish to explore and enjoy. Made from durable and non-toxic materials, it\'s safe for use in freshwater and saltwater tanks. With its easy-to-clean surface and secure placement, it\'s the perfect decoration for novice and experienced fish enthusiasts alike. Transform your fish tank into a colorful underwater paradise with FinnyFrenzy Fish Tank Decor.', 200, '', '', 1, 0),
(35, 'AviaryAvenue Bird Perch', 'The AviaryAvenue Bird Perch is a comfortable and secure perch for small birds like parakeets, finches, and canaries. Its natural wood design provides a comfortable and stable surface for your bird to rest, play, and exercise on. The adjustable height and easy-to-install design make it suitable for a variety of bird cages and aviaries. Plus, its smooth surface and non-toxic finish ensure the safety and well-being of your feathered friend. Give your bird the perfect place to perch with AviaryAvenue Bird Perch.', 250, '', '', 1, 0);
